  [],\n\t\"revision_timestamp\": \"2016-08-04T08:17:55.611796\",\n\t\"name\": \"becharof-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Becharof
  NWR outlines Refuge accomplishments during the 1984 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  public participation, and compliance with environmental and cultural resource mandates.
  Refuge administration is outlined; information about personnel, youth programs,
  funding, and safety is given. Habitat management is also covered; subjects include
  wetlands, forests, and wilderness areas. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries resources,
  and marking and bird banding. The public uses of the Refuge described in this report
  include hunting, fishing, trapping, wildlife observation, outdoor recreation, and
  law enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment replacement,
  communication systems, and energy conservation. Cooperative programs and items of
  interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
